import React from "react";


const Todos = ({todos, deleteTodos}) => {

    const TodoList = todos.lenght ? (
            todos.map(todo => {
                return (
                    <div>
                        <span onClick={() => {
                            deleteTodos(todo.id)
                        }}>{todo.text}</span>
                    </div>
                )
            })

        ) :
        (

            <p>there's no todos</p>

        )
    return(
        <div>
            
        </div>
    )



};


export default Todos;
